import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';

const App = () => {
    return (
        <div className="ui container comments">
            <CommentDetail avatar={faker.image.avatar()} author="Sam" timeAgo="Today at 4:45PM" commentText="Nice blog post!" />
            <CommentDetail avatar={faker.image.avatar()} author="Alex" timeAgo="Today at 4:50AM" commentText="Well done!" />
            <CommentDetail avatar={faker.image.avatar()} author="Jane" timeAgo="Yesterday at 6:55PM" commentText="So funny!" />
        </div>
    )
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
);
